import { View, Text, Pressable } from 'react-native'
import React from 'react'

const ChatList = () => {
  return (
    <View>
      <Text className={"text-red-400"}>Chat List</Text>
      <Pressable className={"bg-cyan-400 "} title="Go to Chat" />
    </View>
  )
}

export default ChatList
